import React from 'react';
import { Paper, Stack, Typography, Button } from '@mui/material';
import CustomTextField from '../input/CustomTextField';
//import { Formik } from 'formik';


const LoginForm  = () =>{
    return(
        <Stack
         spacing = {4}
         sx={{padding : 4}}
         >
            <CustomTextField 
             label = {'Email'}
             variant = {'standard' }
             />
             <CustomTextField 
             label = {'Password'}
             variant = {'standard'}
             />
             <CustomTextField 
             label = {'Confirm password'}
             variant = {'standard'}
             />
             <Button
              variant = 'contained'
              >
                Create account
             </Button>
        </Stack>
    );

}

export default LoginForm;
